import React, { useState, useEffect } from 'react';
import "./style.css";

const HalakList = () => {
    const [halak, setHalak] = useState([]);

    useEffect(() => {
        fetch('https://localhost:7129/api/Halak/halak')
            .then((response) => response.json())
            .then((data) => setHalak(data));
    }, []);

    return (
        <div>
            <h3>Halak a tavakban</h3>
            <table>
                <thead>
                    <tr>
                        <th>Hal neve</th>
                        <th>Faj</th>
                        <th>Méret (cm)</th>
                        <th>Tó neve</th>
                    </tr>
                </thead>
                <tbody>
                    {halak.map((hal) => (
                        <tr key={hal.id}>
                            <td>{hal.nev}</td>
                            <td>{hal.faj}</td>
                            <td>{hal.meretCm}</td>
                            <td>{hal.toNev}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

const FogasokList = () => {
    const [fogasok, setFogasok] = useState([]);

    useEffect(() => {
        fetch('https://localhost:7129/api/Halak/fogasok')
            .then((response) => response.json())
            .then((data) => setFogasok(data));
    }, []);

    return (
        <div>
            <h3>Fogások listája</h3>
            <table>
                <thead>
                    <tr>
                        <th>Horgász neve</th>
                        <th>Hal neve</th>
                        <th>Dátum</th>
                    </tr>
                </thead>
                <tbody>
                    {fogasok.map((fogas, index) => (
                        <tr key={index}>
                            <td>{fogas.horgaszNev}</td>
                            <td>{fogas.halNev}</td>
                            <td>{fogas.datum}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

const Top3Hal = () => {
    const [topHalak, setTopHalak] = useState([]);

    useEffect(() => {
        fetch('/api/top3hal')
            .then((response) => response.json())
            .then((data) => setTopHalak(data));
    }, []);

    return (
        <div>
            <h3>Top 3 legnagyobb hal</h3>
            <table>
                <thead>
                    <tr>
                        <th>Hal neve</th>
                        <th>Méret (cm)</th>
                    </tr>
                </thead>
                <tbody>
                    {topHalak.map((hal, index) => (
                        <tr key={index}>
                            <td>{hal.nev}</td>
                            <td>{hal.meretCm}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

const App = () => {
    return (
        <div>
            <h1>Horgászat - Halak és fogások</h1>
            <HalakList />
            <FogasokList />
            <Top3Hal />
        </div>
    );
};

export default App;
